styles:
	  .flex {
	    @apply(--layout-horizontal);
	    -webkit-flex: 1 1 auto;
	  }
    :host {
      display: block;
      padding: 24px;
      font-family: 'Roboto', 'Noto', sans-serif;
      font-size: 14px;
    }
    .form-title {
      margin-bottom: 20px;
    }
    .card {
      background: white;
      max-width: 400px;
      min-width: 300px;
      min-height: 300px;
      padding: 0;
      margin: 20px 20px auto 10px;
    }
    .card paper-header-panel {
    	margin: 0;
      min-height: 300px;
      max-height: 300px
    }
    .card-content {
    	padding: 16px;
    }
    .info {
    	background-color: #0000ff;
    }
    .ok {
    	background-color: #009900;
    }
    .warning {
    	background-color: #ff9900;
    }
    .critical {
    	background-color: #cc0000;
    }
